const initial = {
    difficulty: '',
    cardType: ''
}

function rootReducer(state = initial, action) {
    switch (action.type) {
        case 'STATE/WELCOME':
            return { ...state, difficulty: state.difficulty.concat(action.payload)}
        default: return state
    }
}

export default rootReducer
